export default class Login extends Component{
    constructor(props){
        super(props);
        this.state = {
            ID:"",
            Name:"",
            Photo:"",
            backendServer : 'http://localhost:8080/'
        }
    }

   


    render(){
        return(
            <div className="form-control">
                <form>
                    <label>ID</label>
                    <input type="text" placeholder="EMP00001"></input>
                    <label>Password</label>
                    <input type="password"></input>
                </form>

            </div>
        )
    }
}
